import React from "react";

const Maping = ()=>
{
    const  str= [10,25,14,18,19,18,18,45];
    return(
        <>
            {
                str.map((e)=>
                {
                    return (
                        <>
                            <h1>{e}</h1>
                        </> 
                    );
                })
            }
        </>
    );
}

export default Maping;
